import React from 'react';

import './header.css';

const Header = () => {
   return (
   <div className="header">
      <div className="leftItem"><div className="itemBox">Home</div><div className="currentPg"></div></div>
      <div className="rightItems"><div className="itemBox">About</div><div className="currentPg"></div></div>
      <div className="rightItems"><div className="itemBox">Contact</div><div className="currentPg"></div></div>
      <div className="rightItems"><div className="loginReg">Login / Register<div className="currentPg"></div></div></div>
      <div className="rightItems"><div className="loginReg">Profile<div className="currentPg"></div></div></div>
   </div>
   )
}

export default Header;
